import React from 'react';

interface FinalScreenProps {
  score: number; 
  skillLevel: string; 
  onRestartClick: () => void; 
}

const FinalScreen: React.FC<FinalScreenProps> = ({
  score,
  skillLevel,
  onRestartClick,
}) => {
  return (
    <div className="FinalScreen">
      <h2>Hai completato il quiz!</h2>
      <p>Il tuo punteggio è: {score}</p>
      <p>Il tuo livello di abilità è: {skillLevel}</p>
      <button onClick={onRestartClick}>Ricomincia il quiz</button>
    </div>
  );
};

export default FinalScreen;
